  /// Update a subscription
  /// &lt;p&gt;Updates an existing subscription to match the specified parameters. When changing prices or quantities, we optionally prorate the price we charge next month to make up for any price changes. To preview how the proration is calculated, use the &lt;a href&#x3D;\&quot;/docs/api/invoices/create_preview\&quot;&gt;create preview&lt;/a&gt; endpoint.&lt;/p&gt;  &lt;p&gt;By default, we prorate subscription changes. For example, if a customer signs up on May 1 for a &lt;currency&gt;100&lt;/currency&gt; price, theyll be billed &lt;currency&gt;100&lt;/currency&gt; immediately. If on May 15 they switch to a &lt;currency&gt;200&lt;/currency&gt; price, then on June 1 theyll be billed &lt;currency&gt;250&lt;/currency&gt; (&lt;currency&gt;200&lt;/currency&gt; for a renewal of her subscription, plus a &lt;currency&gt;50&lt;/currency&gt; prorating adjustment for half of the previous months &lt;currency&gt;100&lt;/currency&gt; difference). Similarly, a downgrade generates a credit that is applied to the next invoice. We also prorate when you make quantity changes.&lt;/p&gt;  &lt;p&gt;Switching prices does not normally change the billing date or generate an immediate charge unless:&lt;/p&gt;  &lt;ul&gt; &lt;li&gt;The billing interval is changed (for example, from monthly to yearly).&lt;/li&gt; &lt;li&gt;The subscription moves from free to paid.&lt;/li&gt; &lt;li&gt;A trial starts or ends.&lt;/li&gt; &lt;/ul&gt;  &lt;p&gt;In these cases, we apply a credit for the unused time on the previous price, immediately charge the customer using the new price, and reset the billing date. Learn about how &lt;a href&#x3D;\&quot;/docs/billing/subscriptions/upgrade-downgrade#immediate-payment\&quot;&gt;Stripe immediately attempts payment for subscription changes&lt;/a&gt;.&lt;/p&gt;  &lt;p&gt;If you want to charge for an upgrade immediately, pass &lt;code&gt;proration_behavior&lt;/code&gt; as &lt;code&gt;always_invoice&lt;/code&gt; to create prorations, automatically invoice the customer for those proration adjustments, and attempt to collect payment. If you pass &lt;code&gt;create_prorations&lt;/code&gt;, the prorations are created but not automatically invoiced. If you want to bill the customer for the prorations before the subscriptions renewal date, you need to manually &lt;a href&#x3D;\&quot;/docs/api/invoices/create\&quot;&gt;invoice the customer&lt;/a&gt;.&lt;/p&gt;  &lt;p&gt;If you dont want to prorate, set the &lt;code&gt;proration_behavior&lt;/code&gt; option to &lt;code&gt;none&lt;/code&gt;. With this option, the customer is billed &lt;currency&gt;100&lt;/currency&gt; on May 1 and &lt;currency&gt;200&lt;/currency&gt; on June 1. Similarly, if you set &lt;code&gt;proration_behavior&lt;/code&gt; to &lt;code&gt;none&lt;/code&gt; when switching between different billing intervals (for example, from monthly to yearly), we dont generate any credits for the old subscriptions unused time. We still reset the billing date and bill immediately for the new subscription.&lt;/p&gt;  &lt;p&gt;Updating the quantity on a subscription many times in an hour may result in &lt;a href&#x3D;\&quot;/docs/rate-limits\&quot;&gt;rate limiting&lt;/a&gt;. If you need to bill for a frequently changing quantity, consider integrating &lt;a href&#x3D;\&quot;/docs/billing/subscriptions/usage-based\&quot;&gt;usage-based billing&lt;/a&gt; instead.&lt;/p&gt;
